BSITE_MAINPAGE_FAQ_006_P2:"També hi ha un ${1}mode de convidat${2} al registre, que no requereix cap mena de dades: en aquest mode, no es realitzen crides al nostre backend. No obstant, a costa de funcions útils com ara poder sincronitzar la biblioteca entre dispositius.",WEBSITE_MAINPAGE_FAQ_007_H1:"Puc emetre al meu televisor?",WEBSITE_MAINPAGE_FAQ_007_P1:"Sí, donem suport a Chromecast i podeu emetre-les des d'aplicacions d'escriptori i mòbils (Android).",WEBSITE_MAINPAGE_FAQ_008_H1:"Quants complements té Stremio?",WEBSITE_MAINPAGE_FAQ_008_P1:"A finals de 2019, més de 50 - per a més informació, consulteu el nostre catàleg de complements.",WEBSITE_MAINPAGE_FAQ_009_H1:"Es pot ampliar Stremio més enllà del que hi ha al catàleg de complements?",WEBSITE_MAINPAGE_FAQ_009_P1:"Sí, hauríeu de comprovar els següents: ${1}PimpMyStremio${2}, ${3}comunitats Reddit${4}, ${5}Stremio Downloader${6}, etc.",WEBSITE_MAINPAGE_FAQ_010_H1:"Quins dispositius admeten Stremio?",WEBSITE_MAINPAGE_FAQ_010_P1:"Disposem d'aplicacions d'escriptori per a Windows, Mac i Linux. Per a mòbils, admetem Android i iOS, tot i que tingueu en compte que la funcionalitat d'IOS és limitada (no admet la majoria dels complements).",WEBSITE_MAINPAGE_FAQ_010_P2:"Hi ha molts dispositius basats en Android en els quals podeu executar Stremio, com NVIDIA Shield i Amazon Fire Stick, però no els admetem oficialment.",WEBSITE_MAINPAGE_FAQ_011_H1:"Podeu afegir un determinat contingut a Stremio?",WEBSITE_MAINPAGE_FAQ_011_P1:"Ho sentim, nosaltres mateixos no proporcionem contingut, però com més complements Stremio tingueu instal·lats, més contingut podreu trobar.",WEBSITE_MAINPAGE_FAQ_012_H1:"Pot Stremio reproduir enllaços magnètics?",WEBSITE_MAINPAGE_FAQ_012_P1:"Sí, i també pot reproduir enllaços HTTP normals i fitxers torrent (arrossegar i deixar anar)..",WEBSITE_MAINPAGE_FAQ_013_H1:"Puc descarregar un vídeo i mirar-lo fora de línia?",WEBSITE_MAINPAGE_FAQ_013_P1:"Disponible fora de línia és una característica pròxima, però si permeteu que Stremio emmagatzemi memòria cau al dispositiu (des del tauler de configuració) podreu veure els vídeos més endavant sense connexió.",WEBSITE_MAINPAGE_FAQ_014_H1:"Res funciona, ajuda'm!",WEBSITE_MAINPAGE_FAQ_014_P1:"Esteu segur que teniu instal·lats complements? Si és així, consulteu el nostre ${1}centre d'ajuda${2}.",WEBSITE_MAINPAGE_FAQ_015_H1:"Com manté Stremio les seves operacions de desenvolupament?",WEBSITE_MAINPAGE_FAQ_015_P1:"Publiquem anuncis no intrusius a través de ${1}AdEx${2}, que és una empresa del mateix equip fundador que se centra en anuncis transparents que preserven la privadesa.",WEBSITE_MAINPAGE_FAQ_015_P2:"Per obtenir més preguntes, aneu al nostre ${1}centre d'ajuda${2}.",HELP_LEARN_MORE:"Ajudeu-nos a obtenir més informació sobre vosaltres.",LIFESTYLE:"Estil de vida",SPORTS:"Esports",FOOD_HEALTH:"Alimentació i salut",BEAUTY_FASHION:"Bellesa i moda",NEWS:"Notícies",GAMING:"Videojocs",SCIENCE_EDUCATION:"Ciència i educació",MUSIC:"Música",TRAVEL:"Viatges",LATE_NIGHT:"Late Night",REALITY:"Reality",COMEDY:"Comèdia",DIY:"Fes-ho tu mateix (DIY)",TECH:"Tecnologia",CINEMA:"Cinema",CONTINUE:"Continua",SLOW_LOADING:"CÀRREGA LENTA?",I_GIVE_UP:"EM RENDEIXO",LEARN_MORE:"Aprèn més",POOR_SOURCE:"Aquesta font té poca disponibilitat o la vostra connexió a Internet no és prou ràpida",PICK_CATEGORIES_ERR:"Heu de triar com a mínim 3 categories",ADJUST_TIMING:"Ajusteu el temps amb ",ADJUST_SIZE:"Ajusta la mida amb ",SEARCH_ANYTHING:"Podeu cercar qualsevol cosa...",ALL_CATEGORIES:"Tots",SEARCH_CATEGORIES:"Pel·lícules, Sèries, YouTube i TV",SEARCH_PERSONS:"Actors, directors i escriptors",SEARCH_PROTOCOLS:"Enllaços HTTP i magnètics",SEARCH_TYPES:"Enllaços IMDB / TVDB",WATCHED:"Vist",SHOW_LESS:"Mostrar menys",LAST_SEARCHES:"Darreres cerques",CLEAR_HISTORY:"Neteja l’historial",CHOOSE_SOME:"TRIA ALGUNS D'AQUEST:",NO_WEB_REMOTE:"No s'ha pogut carregar el comandament a distància web",STREMIO_OFFLINE:"Stremio està fora de línia",STREMIO_EXPENSIVE_CONNECTI