WEBSITE_MAINPAGE_FAQ_007_H1:"Televizyonuma yayınlayabilir miyim?",WEBSITE_MAINPAGE_FAQ_007_P1:"Evet, Chromecast'i destekliyoruz ve hem masaüstü hem de mobil uygulamalardan (Android) yayınlayabilirsiniz.",WEBSITE_MAINPAGE_FAQ_008_H1:"Stremio'nun kaç eklentisi var?",WEBSITE_MAINPAGE_FAQ_008_P1:"2019 sonu itibariyla, 50'nin üzerinde. Daha fazla bilgi için eklenti kataloğumuza bakın.",WEBSITE_MAINPAGE_FAQ_009_H1:"Stremio eklenti kataloğundakinin ötesine genişletilebilir mi?",WEBSITE_MAINPAGE_FAQ_009_P1:"Evet, şunları kontrol etmelisiniz: ${1}PimpMyStremio${2}, ${3}Reddit toplulukları${4}, ${5}Stremio İndirici${6} vb.",WEBSITE_MAINPAGE_FAQ_010_H1:"Stremio hangi cihazları destekliyor?",WEBSITE_MAINPAGE_FAQ_010_P1:"Windows, Mac ve Linux için masaüstü uygulamalarımız mevcut. Mobil cihazlar için, Android ve iOS'u destekliyoruz. Ancak iOS'un işlevsellik açısından sınırlı olduğunu unutmayın (çoğu eklentiyi desteklemez).",WEBSITE_MAINPAGE_FAQ_010_P2:"NVIDIA Shield ve Amazon Fire Stick gibi Stremio'yu çalıştırabileceğiniz birçok Android tabanlı cihaz var. Ancak bunları resmi olarak desteklemiyoruz.",WEBSITE_MAINPAGE_FAQ_011_H1:"Stremio'ya bazı içerikler ekleyebilir misiniz?",WEBSITE_MAINPAGE_FAQ_011_P1:"Üzgünüz, kendimizi hiçbir içeriği sağlamıoruz. Ancak ne kadar çok Stremio eklentisi yüklerseniz, o kadar çok içerik bulabilirsiniz.",WEBSITE_MAINPAGE_FAQ_012_H1:"Stremio magnet bağlantılarını oynayabilir mi?",WEBSITE_MAINPAGE_FAQ_012_P1:"Evet. Ayrıca normal HTTP bağlantılarını ve torrent dosyalarını da oynatabilir (sürükleyin ve bırakın).",WEBSITE_MAINPAGE_FAQ_013_H1:"Bir video indirip çevrimdışı izleyebilir miyim?",WEBSITE_MAINPAGE_FAQ_013_P1:"Çevrimdışı kullanım gelecek bir özelliktir. Ancak Stremio'nun cihazınızda önbelleklemesine izin verirseniz (ayarlar panelinden) videoyu daha sonra bağlantı olmadan izleyebilirsiniz.",WEBSITE_MAINPAGE_FAQ_014_H1:"Hiçbir şey çalışmıyor, yardım edin!",WEBSITE_MAINPAGE_FAQ_014_P1:"Eklentileri yüklediğinizden emin misiniz? Cevabınız evetse, ${1}yardım merkezimize${2} danışın.",WEBSITE_MAINPAGE_FAQ_015_H1:"Stremio geliştirme faaliyetlerini nasıl sürdürüyor?",WEBSITE_MAINPAGE_FAQ_015_P1:"Gizliliği koruyan, şeffaf reklamlara odaklanan aynı kurucu ekibin bir şirketi olan ${1}AdEx${2} aracılığıyla müdahaleci olmayan reklamlar yayınlıyoruz.",WEBSITE_MAINPAGE_FAQ_015_P2:"Daha fazla soru için ${1}yardım merkezimize${2} gidin.",HELP_LEARN_MORE:"Hakkınızda daha fazla bilgi edinmemize yardımcı olun.",LIFESTYLE:"Yaşam stili",SPORTS:"Spor",FOOD_HEALTH:"Yemek ve Sağlık",BEAUTY_FASHION:"Güzellik ve Moda",NEWS:"Haber",GAMING:"Oyun",SCIENCE_EDUCATION:"Bilim ve Eğitim",MUSIC:"Müzik",TRAVEL:"Seyahat",LATE_NIGHT:"Gece Şovu",REALITY:"Reality",COMEDY:"Komedi",DIY:"Nasıl Yapılır?",TECH:"Teknoloji",CINEMA:"Sinema",CONTINUE:"Devam et",SLOW_LOADING:"YAVAŞ MI YÜKLENİYOR?",I_GIVE_UP:"VAZGEÇTİM",LEARN_MORE:"Daha fazlasını öğrenin",POOR_SOURCE:"Kaynak kötü veya İnternet bağlantınız yeterince hızlı değil",PICK_CATEGORIES_ERR:"En az 3 kategori seçmeniz gerekiyor",ADJUST_TIMING:"Zamanlama ayarlama",ADJUST_SIZE:"Boyut ayarlama",SEARCH_ANYTHING:"Her şeyi arayabilirsin...",ALL_CATEGORIES:"Tümü",SEARCH_CATEGORIES:"Filmler, Diziler, YouTube ve TV",SEARCH_PERSONS:"Aktörler, Yönetmenler ve Yazarlar",SEARCH_PROTOCOLS:"HTTP ve Magnet Bağlantıları",SEARCH_TYPES:"IMDB / TVDB Bağlantıları",WATCHED:"İzlendi",SHOW_LESS:"Daha az göster",LAST_SEARCHES:"Son aramalar",CLEAR_HISTORY:"Geçmişi temizle",CHOOSE_SOME:"BUNLARDAN BAZILARINI SEÇ:",NO_WEB_REMOTE:"Web Uzaktan Kontrolü yüklenemedi",STREMIO_OFFLINE:"Stremio çevrimdışı",STREMIO_EXPENSIVE_CONNECTION:"Ağ bağlantısı maliyetli",USE_DATA:"Veriyi kullan",WARNING:"Dikkat",MORE_INFO:"Daha fazla bilgi ...",STREMIO_TV_STREMIO:"Stremio",STREMIO_TV_LOADING:"Yükleniyor ...",STREMIO_TV_BACK_TO_LANGUAGES:"Dillere geri dön",STREMIO_TV_REMOTE:"Uzaktan Kontrol",STREMIO_TV_GO_TO:"Git:",STREMIO_TV_OR_SCAN:"ve tara:",STREMIO_TV_ADDON_INSTRUCTIONS:"Tercih ettiğiniz eklentileri yüklemek için lütfen talimatları uygulayın.",ST