FAQ_003_P1:"很多：电影、电视节目、网络频道、体育、电视频道、收听播客等等。感谢我们的插件系统，您可以访问各种内容。",WEBSITE_MAINPAGE_FAQ_004_H1:"Stremio是开源的吗？",WEBSITE_MAINPAGE_FAQ_004_P1:"是的，您可以查看以下链接：${1}桌面应用${2}和${3}GitHub组织${4}。",WEBSITE_MAINPAGE_FAQ_005_H1:"Stremio安全吗？",WEBSITE_MAINPAGE_FAQ_005_P1:"是：因为它是开源软件，所以代码可以公开审核，您可以自己查看。",WEBSITE_MAINPAGE_FAQ_006_H1:"我的隐私如何？",WEBSITE_MAINPAGE_FAQ_006_P1:"我们尊重用户隐私，除了创建和同步您的帐户所必需的最低限度外，不收集任何个人数据。",WEBSITE_MAINPAGE_FAQ_006_P2:"注册时还有一个${1}访客模式${2}，它不需要任何数据：在这种模式下，不会调用我们的后端。然而，这是以牺牲有用的功能为代价的，比如能够跨设备同步您的库。",WEBSITE_MAINPAGE_FAQ_007_H1:"我可以投屏到电视吗？",WEBSITE_MAINPAGE_FAQ_007_P1:"是的，我们支持Chromecast，您可以从桌面和移动应用程序（Android）进行强制转换。",WEBSITE_MAINPAGE_FAQ_008_H1:"Stremio有多少插件？",WEBSITE_MAINPAGE_FAQ_008_P1:"截至2019年末，超过50个。有关更多信息，请查看我们的插件目录。",WEBSITE_MAINPAGE_FAQ_009_H1:"Stremio是否可以扩展到插件目录之外？",WEBSITE_MAINPAGE_FAQ_009_P1:"是的，您应该查看这些：${1}PimpMyStremio${2}，${3}Reddit communities${4}，${5}Stremio Downloader${6}，等等。",WEBSITE_MAINPAGE_FAQ_010_H1:"Stremio支持哪些设备？",WEBSITE_MAINPAGE_FAQ_010_P1:"我们有适用于Windows、Mac和Linux的桌面应用程序。对于移动设备，我们支持Android和iOS，但请记住iOS的功能有限（不支持大多数插件）。",WEBSITE_MAINPAGE_FAQ_010_P2:"有很多基于Android的设备可以在上面运行Stremio，比如NVIDIA Shield和Amazon Fire Stick，但我们并不正式支持它们。",WEBSITE_MAINPAGE_FAQ_011_H1:"您们能为Stremio添加某些内容吗？",WEBSITE_MAINPAGE_FAQ_011_P1:"抱歉，我们本身不提供任何内容，但是您安装的Stremio插件越多，您可以找到的内容就越多。",WEBSITE_MAINPAGE_FAQ_012_H1:"Stremio可以播放Magnet链接吗？",WEBSITE_MAINPAGE_FAQ_012_P1:"是的，它还可以播放正常的HTTP链接和Torrent文件（拖放）。",WEBSITE_MAINPAGE_FAQ_013_H1:"我可以下载视频并离线观看吗？",WEBSITE_MAINPAGE_FAQ_013_P1:"离线可用是一项即将推出的功能，但如果您允许Stremio在设备上缓存（从“设置”面板），您可以稍后在没有连接的情况下观看视频。",WEBSITE_MAINPAGE_FAQ_014_H1:"什么都不能用，帮帮我！",WEBSITE_MAINPAGE_FAQ_014_P1:"您确定已安装插件吗？如果是，请与我们的${1}帮助中心${2}联系",WEBSITE_MAINPAGE_FAQ_015_H1:"Stremio如何维持其开发运营？",WEBSITE_MAINPAGE_FAQ_015_P1:"我们通过${1}AdEx${2}运行非侵入性广告，这是一家由同一创始团队创建的公司，专注于隐私保护、透明广告。",WEBSITE_MAINPAGE_FAQ_015_P2:"有关更多问题，请访问我们的${1}帮助中心${2}。",HELP_LEARN_MORE:"帮助我们了解更多有关您的信息。",LIFESTYLE:"生活方式",SPORTS:"体育",FOOD_HEALTH:"饮食与健康",BEAUTY_FASHION:"美丽与时尚",NEWS:"新闻",GAMING:"游戏",SCIENCE_EDUCATION:"科学与教育",MUSIC