_001_P1:"Stremio是一個現代化的媒體中心，讓您可以自由觀看任何您想要的東西。",WEBSITE_MAINPAGE_FAQ_002_H1:"它是如何工作的？",WEBSITE_MAINPAGE_FAQ_002_P1:"一旦您在設備上安裝了Stremio並創建了一個帳户，您所要做的就是訪問插件目錄並安裝任何您想要的插件，就可以開始了！",WEBSITE_MAINPAGE_FAQ_002_P2:"之後，您可以進入“發現”或“板”部分，開始探索內容。",WEBSITE_MAINPAGE_FAQ_003_H1:"我可以在這裏看什麼？",WEBSITE_MAINPAGE_FAQ_003_P1:"很多：電影、電視節目、網絡頻道、體育、電視頻道、收聽播客等等。感謝我們的插件系統，您可以訪問各種內容。",WEBSITE_MAINPAGE_FAQ_004_H1:"Stremio是開源的嗎？",WEBSITE_MAINPAGE_FAQ_004_P1:"是的，您可以查看以下鏈接：${1}桌面應用${2}和${3}GitHub組織${4}。",WEBSITE_MAINPAGE_FAQ_005_H1:"Stremio安全嗎？",WEBSITE_MAINPAGE_FAQ_005_P1:"是：因為它是開源軟件，所以代碼可以公開審核，您可以自己查看。",WEBSITE_MAINPAGE_FAQ_006_H1:"我的隱私如何？",WEBSITE_MAINPAGE_FAQ_006_P1:"我們尊重用户隱私，除了創建和同步您的帳户所必需的最低限度外，不收集任何個人數據。",WEBSITE_MAINPAGE_FAQ_006_P2:"註冊時還有一個${1}訪客模式${2}，它不需要任何數據：在這種模式下，不會調用我們的後端。然而，這是以犧牲有用的功能為代價的，比如能夠跨設備同步您的庫。",WEBSITE_MAINPAGE_FAQ_007_H1:"我可以投屏到電視嗎？",WEBSITE_MAINPAGE_FAQ_007_P1:"是的，我們支持Chromecast，您可以從桌面和移動應用程序（Android）進行強制轉換。",WEBSITE_MAINPAGE_FAQ_008_H1:"Stremio有多少插件？",WEBSITE_MAINPAGE_FAQ_008_P1:"截至2019年末，超過50個。有關更多信息，請查看我們的插件目錄。",WEBSITE_MAINPAGE_FAQ_009_H1:"Stremio是否可以擴展到插件目錄之外？",WEBSITE_MAINPAGE_FAQ_009_P1:"是的，您應該查看這些：${1}PimpMyStremio${2}，${3}Reddit communities${4}，${5}Stremio Downloader${6}，等等。",WEBSITE_MAINPAGE_FAQ_010_H1:"Stremio支持哪些設備？",WEBSITE_MAINPAGE_FAQ_010_P1:"我們有適用於Windows、Mac和Linux的桌面應用程序。對於移動設備，我們支持Android和iOS，但請記住iOS的功能有限（不支持大多數插件）。",WEBSITE_MAINPAGE_FAQ_010_P2:"有很多基於Android的設備可以在上面運行Stremio，比如NVIDIA Shield和Amazon Fire Stick，但我們並不正式支持它們。",WEBSITE_MAINPAGE_FAQ_011_H1:"您們能為Stremio添加某些內容嗎？",WEBSITE_MAINPAGE_FAQ_011_P1:"抱歉，我們本身不提供任何內容，但是您安裝的Stremio插件越多，您可以找到的內容就越多。",WEBSITE_MAINPAGE_FAQ_012_H1:"Stremio可以播放Magnet鏈接嗎？",WEBSITE_MAINPAGE_FAQ_012_P1:"是的，它還可以播放正常的HTTP鏈接和Torrent文件（拖放）。",WEBSITE_MAINPAGE_FAQ_013_H1:"我可以下載視頻並離線觀看嗎？",WEBSITE_MAINPAGE_FAQ_013_P1:"離線可用是一項即將推出的功能，但如果您允許Stremio在設備上緩存（從“設置”面板），您可以稍後在沒有連接的情況下觀看視頻。",WEBSITE_MAINPAGE_FAQ_014_H1:"什麼都不能用，幫幫我！",WEBSITE_MAINPAGE_FAQ_014_P1:"您確定已安裝插件嗎？如果是，請與我們的${1}幫助中心${2}聯繫",WEBSITE_MAINPAGE_FAQ_015_H1:"Stremio如何維持其開發運營？",WEBSITE_MAIN