WEBSITE_LINK_OTHER_DOWNLOADS:"其他下載",WEBSITE_FAQ_ABR:"常見問題",WEBSITE_SUPPORT:"支援",WEBSITE_DOWNLOAD_4_0_BETA:"立即下載Stremio 4測試版",WEBSITE_GET_FOR_DESKTOP:"獲取桌面",WEBSITE_LINK_ADDON_COMPETITION:"外掛比賽",WEBSITE_LINK_ART_CONTEST:"藝術比賽",WEBSITE_MY_ACCOUNT:"我的賬戶",WEBSITE_MAINPAGE_FAQ_001_H1:"什麼是Stremio？",WEBSITE_MAINPAGE_FAQ_001_P1:"Stremio是一個現代化的媒體中心，讓您可以自由觀看任何您想要的東西。",WEBSITE_MAINPAGE_FAQ_002_H1:"它是如何工作的？",WEBSITE_MAINPAGE_FAQ_002_P1:"一旦您在裝置上安裝了Stremio並建立了一個帳戶，您所要做的就是訪問外掛目錄並安裝任何您想要的外掛，就可以開始了！",WEBSITE_MAINPAGE_FAQ_002_P2:"之後，您可以進入“發現”或“板”部分，開始探索內容。",WEBSITE_MAINPAGE_FAQ_003_H1:"我可以在這裡看什麼？",WEBSITE_MAINPAGE_FAQ_003_P1:"很多：電影、電視節目、網路頻道、體育、電影片道、收聽播客等等。感謝我們的外掛系統，您可以訪問各種內容。",WEBSITE_MAINPAGE_FAQ_004_H1:"Stremio是開源的嗎？",WEBSITE_MAINPAGE_FAQ_004_P1:"是的，您可以檢視以下連結：${1}桌面應用${2}和${3}GitHub組織${4}。",WEBSITE_MAINPAGE_FAQ_005_H1:"Stremio安全嗎？",WEBSITE_MAINPAGE_FAQ_005_P1:"是：因為它是開源軟體，所以程式碼可以公開稽核，您可以自己檢視。",WEBSITE_MAINPAGE_FAQ_006_H1:"我的隱私如何？",WEBSITE_MAINPAGE_FAQ_006_P1:"我們尊重使用者隱私，除了建立和同步您的帳戶所必需的最低限度外，不收集任何個人資料。",WEBSITE_MAINPAGE_FAQ_006_P2:"註冊時還有一個${1}訪客模式${2}，它不需要任何資料：在這種模式下，不會呼叫我們的後端。然而，這是以犧牲有用的功能為代價的，比如能夠跨裝置同步您的庫。",WEBSITE_MAINPAGE_FAQ_007_H1:"我可以投屏到電視嗎？",WEBSITE_MAINPAGE_FAQ_007_P1:"是的，我們支援Chromecast，您可以從桌面和移動應用程式（Android）進行強制轉換。",WEBSITE_MAINPAGE_FAQ_008_H1:"Stremio有多少外掛？",WEBSITE_MAINPAGE_FAQ_008_P1:"截至2019年末，超過50個。有關更多資訊，請檢視我們的外掛目錄。",WEBSITE_MAINPAGE_FAQ_009_H1:"Stremio是否可以擴充套件到外掛目錄之外？",WEBSITE_MAINPAGE_FAQ_009_P1:"是的，您應該檢視這些：${1}PimpMyStremio${2}，${3}Reddit communities${4}，${5}Stremio Downloader${6}，等等。",WEBSITE_MAINPAGE_FAQ_010_H1:"Stremio支援哪些裝置？",WEBSITE_MAINPAGE_FAQ_010_P1:"我們有適用於Windows、Mac和Linux的桌面應用程式。對於移動裝置，我們支援Android和iOS，但請記住iOS的功能有限（不支援大多數外掛）。",WEBSITE_MAINPAGE_FAQ_010_P2:"有很多基於Android的裝置可以在上面執行Stremio，比如NVIDIA Shield和Amazon Fire Stick，但我們並不正式支援它們。",WEBSITE_MAINPAGE_FAQ_011_H1:"您們能為Stremio新增某些內容嗎？",WEBSITE_MAINPAGE_FAQ_011_P1:"抱歉，我們本身不提供任何內容，但是您安裝的Stremio外掛越多，您可以找到的內容就越多。",WEBSITE_MAINPAGE_FAQ_012_H1:"Stremio可以播放Magnet連結嗎？",WEBSITE_MAINPAGE_FAQ_012_P1:"是的，它還可以播放正常的HTTP連結和Torrent檔案（拖放）。",WEBSITE_MAINPAGE_FAQ_013_H1:"我可以下載影片並離線觀看嗎？",WEBSITE_MAINPAGE_FAQ_013_P1:"離線可用是一項即將推出的功能，但如果您允許Stremio在裝置上快取（從“設定”面板），您可以稍後在沒有連線的情況下觀看影片。",WEBSITE_MAINPAGE_FAQ_014_H1:"什麼都不能用，幫幫我！",WEBSITE_MAINPAGE_FAQ_014_P1:"您確定已安裝外掛嗎？如果是，請與我們的${1}幫助中心${2}聯絡",WEBSITE_MAINPAGE_FAQ_015_H1:"Stremio如何維持其開發運營？",WEBSITE_MAINPAGE_FAQ_015_P1:"我們透過${1}AdEx${2}執行非侵入性廣告，這是一家由同一創始團隊建立的公司，專注於隱私保護、透明廣告。",WEBSITE_MAINPAGE_FAQ_015_P2:"有關更多問題，請訪問我們的${1}幫助中心${2}。",HELP_LEARN_MORE:"幫助我們瞭解更多有關您的資訊。",LIFESTYLE:"生活方式",SPORTS:"體育",FOOD_HEALTH:"飲食與健康",BEAUTY_FASHION:"美麗與時尚",NEWS:"新聞",GAMING:"遊戲",SCIENCE_EDUCATION:"科學與教育",MUSIC:"音樂",TRAVEL:"旅行",LATE_NIGHT:"深夜",REALITY:"真人",COMEDY:"喜劇",DIY:"DIY",TECH:"技術",CINEMA:"影院",CONTINUE:"繼續",SLOW_LOADING:"載入緩慢？",I_GIVE_UP:"我放棄了",LEARN_MORE:"瞭解更多",POOR_SOURCE:"此源不可用或您的網路連線不夠快",PICK_CATEGORIES_ERR:"您必須至少選擇3個類別",ADJUST_TIMING:"調整時間",ADJUST_SIZE:"調整大小",SEARCH_ANYTHING:"您可以搜尋一切...",ALL_CATEGORIES:"全部",SEARCH_CATEGORIES:"電影、劇集、YouTube和電視",SEARCH_PERSONS:"演員、導演和編劇",SEARCH_PROTOCOLS:"HTTP或Magnet連結",SEARCH_TYPES:"IMDB/TVDB連結",WATCHED:"已觀看",SHOW_LESS:"顯示較少",LAST_SEARCHES:"上次搜尋",CLEAR_HISTORY:"清除歷史記錄",CHOOSE_SOME:"選擇其中一些：",NO_WEB_REMOTE:"無法載入Web Remote",STREMIO_OFFLINE:"Stremio離線",STREMIO_EXPENSIVE_CONNECTION:"我們檢測到您正在使用移動資料連線，是否繼續？",USE_DATA:"使用移動資料",WARNING:"警告",MORE_INFO:"更多資訊...",STREMIO_TV_STREMIO:"Stremio",STREMIO_TV_LOADING:"載入...",STREMIO_TV_BACK_TO_LANGUAGES:"返回語言",STREMIO_TV_REMOTE:"遠端",STREMIO_TV_GO_TO:"去往：",STREMIO_TV_OR_SCAN:"或掃描：",STREMIO_TV_ADDON_INSTRUCTIONS:"請按照說明安裝您喜歡的外掛。",STREMIO_TV_LIVE_TV:"直播電視",STREMIO_TV_RESUME_WATCHING:"繼續觀看",STREMIO_TV_LOADING_BACKGROUND:"載入背景",STREMIO_TV_CHECKING_AUTHENTICATION:"正在檢測身份驗證",STREMIO_TV_LOADING_BOARD:"載入主頁",STREMIO_TV_LOGIN_HEADER_LINE_1:"我們希望使用者在使用我們的軟體時有最好的個性化體驗，",STREMIO_TV_LOGIN_HEADER_LINE_2:"正是出於這個原因，我們懇請您建立和/或登入您的賬戶，",STREMIO_TV_LOGIN_FOOTER_LINE_1:"感謝您的理解，",STREMIO_TV_LOGIN_FOOTER_LINE_2:"Stremio團隊",STREMIO_TV_REMOTE_INSTRUCTIONS:"為了在您的智慧手機/平板電腦/桌面使用Web Remote：",STREMIO_TV_WIFI_SETUP:"Wi-Fi設定",STREMIO_